  },
  {
    title: 'Project 2',
    description: 'Description of Project 2',
    image: 'project2.jpg', // Replace with the actual image path
  },
  {
    title: 'Project 3',
    description: 'Description of Project 3',
    image: 'project3.jpg', // Replace with the actual image path
  },
  {
    title: 'Project 4',
    description: 'Description of Project 4',
    image: 'project4.jpg', // Replace with the actual image path
  },
  // Add more projects here
];

const Projects = () => {
  return (
    <div>
      <div className="slides">
        <button onClick={goToPrevSlide} className="slide-button prev-button">
          &lt; Previous
        </button>
        <div className="slide">
          <img
            src={topAchievements[currentSlide].image}
            alt={topAchievements[currentSlide].title}
          />
          <h3>{topAchievements[currentSlide].title}</h3>
          <p>{topAchievements[currentSlide].description}</p>
        </div>
        <button onClick={goToNextSlide} className="slide-button next-button">
          Next &gt;
        </button>
      </div>
      <div className="projects">
        {projects.map((project, index) => (
          <div className="project-card" key={index}>
            <h2>{project.title}</h2>
            <p>{project.description}</p>
            <img src={project.image} alt={project.title} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
